After stealing a mysterious orb in the far reaches of outer space, Peter Quill from Earth, is now the main target of a manhunt led by the villain known as Ronan the Accuser. To help fight Ronan and his team and save the galaxy from his power, Quill creates a team of space heroes known as the &quot;Guardians of the Galaxy&quot; to save the world. 

Director: James Gunn
Writers: James Gunn, Nicole Perlman
Stars: Chris Pratt, Vin Diesel, Bradley Cooper 
Genres: Action, Adventure, Sci-Fi
Country: USA
Language: English


